import React from 'react';
import $ from 'jquery';
import Location from './Location';

function Shipping() {

    let locationData = sessionStorage.getItem('location')

    if (locationData === null)
        $.ajax({
            url: 'https://yrtt-readers.github.io/the-bookclub/assets/data/locations.json',
            async: false,
            success: data => {
                try {
                    sessionStorage
                        .setItem('location',
                            JSON.stringify(data))

                    locationData = sessionStorage.getItem('location')
                } catch (e) { console.log(e) }
            }
        })

    locationData = JSON.parse(locationData)

    return (
        <div>
            <section className="container container-margin">
                <div className="text-center">
                    <h1 className="text-center">Drop off or pick up your books at:</h1>
                    <div className='col-lg-4 col-sm-6 location'>
                        <img
                            className='img-thumbnail'
                            src={locationData.thumbnail}
                            alt='location-image-not-found'
                        />
                        <p className='location-address'>
                            <strong>{locationData.address}</strong>
                        </p>
                        <p className='location-postcode'>{locationData.postcode}</p>
                        </div>
                </div>
            </section>
        </div>
    );
}

export default Shipping;
